import React, { Component } from 'react';
import Books from "./pages/Books";
import Search from "./pages/Search";
import Saved from "./pages/Saved";
import Header from "./components/Header";
import './components/Header';

function App() {
  return (
    <div>
      <Header />
      <Books />
      <Search/>
      <Saved/>
    </div>
  );
}

export default App;
